/* eslint-disable react-hooks/exhaustive-deps */
/* eslint-disable jsx-a11y/img-redundant-alt */
import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { getDogById } from "../../redux/actions";

const DeatilDogs = () => {
  const { id } = useParams();
  const dispatch = useDispatch();
  const characterDog = useSelector((state) => state.characterDog);

  useEffect(() => {
    dispatch(getDogById(id));
  }, []);

  console.log(characterDog[0]);

  return (
    <div>
      {characterDog[0] ? <h1>{characterDog[0].name}</h1> : null}
      {characterDog[0]?.image ? (
        <img src={characterDog[0]?.image.url} alt="Not image" />
      ) : (
        <img src={characterDog[0]?.image} alt="Not image" />
      )}
      {characterDog[0] ? <h2>{characterDog[0].bread_for}</h2> : null}
      {characterDog[0] ? <h2>{characterDog[0].breed_group}</h2> : null}
      {characterDog[0] ? <h2>{characterDog[0].life_span}</h2> : null}
      {characterDog[0] ? <h2>{characterDog[0].temperament}</h2> : null}
      {characterDog[0] ? <h2>{characterDog[0].origin}</h2> : null}
      {characterDog[0]?.weight.imperial ? (
        <h2>
          Weight:
          {characterDog[0]?.weight.imperial} Lb /
          {characterDog[0]?.weight.metric} Kg
        </h2>
      ) : (
        <h2>Weight: {characterDog[0].weight} kg</h2>
      )}
      {characterDog[0].height.imperial ? (
        <h2>
          Height: {characterDog[0]?.height.imperial} in /{characterDog[0]?.height.metric} cm
        </h2>
      ) : (
        <h2>Height: {characterDog[0]?.height} cm</h2>
      )}
    </div>
  );
};

export default DeatilDogs;
